import { createStore } from 'vuex'
// import axios from 'axios';

export default createStore({
  state: {
    idCliente:[]
  },
  getters: {
    allDados: state => state.idCliente,
  },
  mutations: {
    products(state, product) {
      state.product = product;
    },
  },
  actions: {
  },
  modules: {
  }
})
